+{
+  "version": 1,
+  "cleanUrls": true,
+  "public": "./dist",  // Path to the folder where your build assets are generated (e.g., after running 'vite build')
+  "rewrites": [
+    {
+      "source": "/**",  // Catch-all route to serve 'index.html' for any URL
+      "destination": "/index.html"
+    }
+  ],
+  "redirects": [
+    {
+      "source": "/old-path",  // Example of an old path you want to redirect
+      "destination": "/new-path",  // The new path to redirect to
+      "statusCode": 301  // Permanent redirect
+    }
+  ],
+  "headers": {
+    "/assets/*": {
+      "Cache-Control": "max-age=31536000, immutable"  // Cache static assets like images and JS for a long time
+    },
+    "/**/*.html": {
+      "Cache-Control": "no-store"  // Prevent caching for HTML files, to always get the latest version
+    }
+  }
+}

